use std::convert::TryFrom;
use std::{collections::HashMap, vec}; pub fn two_sum(nums: Vec<i32>, target: i32) -> Vec<i32> { let mut element_index_cache: HashMap<i32, i32> = HashMap::new(); for (i, e) in nums.into_iter().enumerate() { let key = target - e; match element_index_cache.get(&key) { Some(v) => { return vec![*v, i as i32]; } None => { element_index_cache.insert(e, i as i32); } } } panic!("impossible")
} pub fn two_sum_brute_force(nums: Vec<i32>, target: i32) -> Vec<i32> { for (i, e1) in nums.iter().enumerate() { for (j, e2) in nums.iter().enumerate() { if i != j && *e1 + *e2 == target { return vec![i as i32, j as i32]; } } } panic!("impossible")
} pub fn two_sum_rec(nums: Vec<i32>, target: i32) -> Vec<i32> { fn func<'a>( nums: &Vec<i32>, target: i32, element_index_cache: &'a mut HashMap<i32, i32>, len: usize, ) -> (&'a HashMap<i32, i32>, Option<Vec<i32>>) { match len { 0 => (element_index_cache, None), _ => { let curr_index = len - 1; let curr_index_i32 = i32::try_from(curr_index).unwrap(); let curr_value = nums[curr_index]; let another = target - curr_value; match element_index_cache.get(&another) { Some(v) => (element_index_cache, Some(vec![curr_index_i32, *v])), None => { element_index_cache.insert(curr_value, curr_index_i32); func(nums, target, element_index_cache, len - 1) } } } } } match func(&nums, target, &mut HashMap::new(), nums.len()) { (_, Some(rst)) => rst, _ => panic!("impossible"), }
} #[cfg(test)]
mod test { use super::*; #[test] fn basic() { assert_eq!(two_sum(vec![2, 7, 15, 13], 9), vec![0, 1]); assert_eq!(two_sum(vec![3, 2, 4], 6), vec![1, 2]); assert_eq!(two_sum(vec![3, 3], 6), vec![0, 1]); assert_eq!(two_sum_rec(vec![2, 7, 15, 13], 9), vec![0, 1]); assert_eq!(two_sum_rec(vec![3, 2, 4], 6), vec![1, 2]); assert_eq!(two_sum_rec(vec![3, 3], 6), vec![0, 1]); assert_eq!(two_sum_brute_force(vec![2, 7, 15, 13], 9), vec![0, 1]); assert_eq!(two_sum_brute_force(vec![3, 2, 4], 6), vec![1, 2]); assert_eq!(two_sum_brute_force(vec![3, 3], 6), vec![0, 1]); }
}

